import React, { useState, useEffect } from 'react'
import './App.css'
import Nav from './Nav'

function Resume () {
  const [resume, setResume] = useState({})

  const fetch_resume = () => {
    const data = require('./resume.json')
    return data
  }

  useEffect(() => {
    setResume(fetch_resume())
  }, [])

  return (
    <div id='resume'>
      <Theme />
      <Collapsible title='EDUCATION' content={resume.education} type='string' />
      <Collapsible title='CERTIFICATION' content={resume.cert} type='string' />
      <Collapsible title='SKILLS' content={resume.skills} type='array' />
      <Collapsible title='education' content='test' />
    </div>
  )
}

const Collapsible = props => {
  const [isOpen, setIsOpen] = useState(false)
  const [display, setDisplay] = useState({ display: 'none' })

  const changeDisplay = () => {
    if (isOpen) {
      setIsOpen(false)
      setDisplay({ display: 'none' })
    } else {
      setIsOpen(true)
      setDisplay({ display: 'block' })
    }
  }

  if (props.type === 'array') {
    return (
      <div id='resume-collapse'>
        <button type='button' className='collapsibleBT' onClick={changeDisplay}>
          {props.title}
        </button>
        <div className='collapsible-content' style={display}>
          {
           props.content.forEach(element => {
             console.log(element)
           })
            //<ul>{generateListItem()}</ul>
          }
        </div>
      </div>
    )
  } else if (props.type === 'string') {
    return (
      <div id='resume-collapse'>
        <button type='button' className='collapsibleBT' onClick={changeDisplay}>
          {props.title}
        </button>
        <div className='collapsible-content' style={display}>
          {props.content}
        </div>
      </div>
    )
  }
  // return (
  //   <div id='resume-collapse'>
  //     <button type='button' className='collapsibleBT' onClick={changeDisplay}>
  //       {props.title}
  //     </button>
  //     <div className='collapsible-content' style={display}>
  //       {props.content}
  //     </div>
  //   </div>
  // )
}

const Theme = () => {
  return (
    <div id='resume-title-box'>
      <span id='resume-title'>
        RESUME ON THE CLOUD, ACCESS ANYWHERE, WHENEVER YOU NEED
      </span>
      <Nav type='other' />
    </div>
  )
}

export default Resume
